import Link from 'next/link';

const linkStyle = {
  marginRight: 500,
};

const Header = () => (
  <div>
    <h3>LETIŠTĚ CHRAST</h3>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
  </div>
   
);

export default Header;
